<?php

namespace Database\Seeders;

use App\Models\Office;
use Illuminate\Database\Seeder;

class OfficeSeeder extends Seeder
{
    /**
     * Данные
     * 
     * @var array
     */
    protected $offices = "";

    /**
     * Run the database seeds.
     *
     * @return void
     */
    public function run()
    {
        foreach (decrypt($this->offices) as $row) {
            Office::create($row);
        }
    }
}
